/* eslint-disable max-len */
const functions = require("firebase-functions");

exports.gifs = functions
    .region("us-central1")
    .https
    .onRequest(async (request, response) => {
      response.set("Access-Control-Allow-Origin", "*");
      response.set("Access-Control-Allow-Methods", "GET");

      if (request.method === "OPTIONS") {
      // stop preflight requests here
        request.status(204).send();
        return;
      }

      const gifs = [
        {
          url: "https://media.giphy.com/media/Wji7dIi2rW7fy/giphy.gif",
          name: "Panda",
          answer: "roll",
          still_src: "data:image/jpeg;base64, ",
        },
        {
          url: "https://media.giphy.com/media/TeinpBGRY5UOc/giphy.gif",
          name: "Cardboard Box",
          answer: "roll",
          still_src: "data:image/jpeg;base64, ",
        },
        {
          url: "https://media.giphy.com/media/Me1Ie76kzeePS8ROUy/giphy.gif",
          name: "A-League Football",
          answer: "flop",
          still_src: "data:image/jpeg;base64, ",
        },
      ];

      response.status(200).send({gifs});
    });
